import React from 'react';
import axios from 'axios';
import SearchBar from './SearchBar';

class AxiosSearch extends React.Component {
  async onSearchSubmit(term) {
      /*
      axios
      .get('https.//api.unsplash.com/search/photos', {
          params: {query: term},
          headers: {
              Authorization: 'Client-ID 34e39e5c2f447ce52009a515846ca2b6ccc35552bb63de59cf4a6d06728f3f7e' //need to get key
          }
      })
      .then (response => {
          console.log(`onSearchSubmit ${response.data.results}`);
      });
      */
     alert(`Term: ${term}`)
  }  
  render() {
      return (
          <div className="ui container" style={{ marginTop: '10px'}}>
            <SearchBar onSubmit={this.onSearchSubmit} />
          </div>
      )
  }
}
export default AxiosSearch;
